import axios from 'axios';
import { Row, Col } from 'react-bootstrap'
import { Component } from 'react';

export default class LandingPageFeaturedShillers extends Component {

    constructor(props) {
        this.state = { shillers: [] };
    }

    componentDidMount() {
        axios
            .get("http://localhost:5000/shiller/")
            .then((response) => {
                console.log("shillerssss",response.data);
                this.setState({ shillers: response.data })
            })
            .catch(function (error) {
                console.log(error);
            });
    }

    shillerCards() {
        return this.state.shillers.map((shiller) => {
            return (
                <Col sm={12} md={4} lg={3}>
                    <Card shiller={shiller} key={shiller._id}/>
                </Col>
            );
        });
    }

    render() {
        return (
            <div>
                <Row>
                    {this.shillerCards()}
                </Row>
            </div>
        );
    }
}
